      //       items: json,
      //       DataisLoaded: true
      //     });
      //   })
  }
  render() {
      const { DataisLoaded, items } = this.state;
      if (!DataisLoaded) return (
          <>
          <Navbar bg="dark" variant="dark">
              <Container>
                  <Navbar.Brand>
                      <img
                          alt=""
                          src={zen}
                          width="40"
                          height="40"
                          className="d-inline-block align-content-between"
                      />{'  '}
                      Zendesk Coding Challenge
                  </Navbar.Brand>
              </Container>
          </Navbar>
          <div style={{display: 'flex', justifyContent: 'center'}}>
              <Spinner animation="border">
                  <span className="visually-hidden">Tickets are being fetched</span>
              </Spinner>
          </div>
          </>
      )
      return (
          <>
              <Navbar bg="dark" variant="dark">
                  <Container>
                      <Navbar.Brand>
                          <img
                              alt=""
                              src={zen}
                              width="40"
                              height="40"
                              className="d-inline-block align-content-between"
                          />{'  '}
                          Zendesk Coding Challenge
                      </Navbar.Brand>
                  </Container>
              </Navbar>
          <ul>
              { items.map((x) =>
                  (
                      <ul>
                          id: {x.id} <br />
                          url: {x.url} <br />
                          status: {x.status} <br />
                          subject: {x.subject} <br />
                          <br />
                      </ul>
                  )
              ) }
          </ul>
         </>
      )
  }
}
